var title_f42_50_43813="Distal femoral Salter-Harris type II fracture";
var content_f42_50_43813=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F83119&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F83119&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 476px\">",
"   <div class=\"ttl\">",
"    Distal femoral Salter-Harris type II fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 587px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) In a Salter-Harris type II fracture, the side where the fracture occurred through the physis has associated disruption of the periosteum (black arrow). The side of the fracture that passes through the metaphysis usually has an intact periosteum that can be used for fracture reduction (red arrow).",
"    <br/>",
"    (B) With fracture reduction, the periosteum may become interposed within the fracture site, preventing an anatomic reduction (arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Price CT, Herrera-Soto J. Extra-articular injuries of the knee. In: Rockwood and Wilkins' Fractures in Children, 7th edition, Beaty JH, Kasser JR. (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2010. Copyright &copy; 2010 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
