var title_f42_50_43814="Reflux episodes identified by combined impedance-pH monitoring";
var content_f42_50_43814=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F80772&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F80772&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 618px\">",
"   <div class=\"ttl\">",
"    Reflux episodes identified by combined impedance-pH monitoring",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 598px; height: 355px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Impedance-measuring segments are located 3, 5, 7, 9, 15, and 17 cm above the lower esophageal sphincter (LES), the esophageal pH sensor 5 cm above the LES (bottom channel). Reflux episodes are detected by the rapid decline in impedance starting in the distal esophagus and over time advancing proximally (ie, retrograde bolus movement). The example on the left (A) is an acid reflux episode as esophageal pH declines from above to below 4.0. Note that the esophageal pH remains below 4.0 longer than the refluxate presence in the esophagus and is later cleared by a swallow. The example on the right (B) is a non-acid reflux episode as the esophageal pH remains above 4.0. Note that this reflux episode would have been missed by conventional pH monitoring alone.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Radu Tutuian, MD, and Donald O. Castell, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
