var title_f42_50_43820="Periop cardiovascular agents";
var content_f42_50_43820=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F62659&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F62659&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Perioperative management of cardiovascular agents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Name or class of drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Clinical considerations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended strategy for surgery with brief NPO state",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended strategy for surgery with prolonged NPO state",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Beta blockers",
"       </td>",
"       <td>",
"        <p>",
"         Abrupt withdrawal can result in hypertension, tachycardia, and myocardial ischemia.",
"        </p>",
"        <p>",
"         Perioperative initiation can prevent postoperative myocardial ischemic events in patients with significantly-increased cardiac risk, but may increase risk for stroke.",
"        </p>",
"        <p>",
"         Perioperative initiation of beta blockers is recommended&nbsp;in patients with at least one cardiac risk factor who are undergoing vascular surgery.",
"        </p>",
"        <p>",
"         Perioperative initiation of beta blockers is not recommended in patients with baseline heart rate &lt;60 beats per minute, systolic blood pressure &lt;90 mmHg, or when time is not sufficient for titration.",
"        </p>",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery. Substitute IV propranolol, metoprolol, or labetalol during NPO state.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Alpha 2 agonists",
"       </td>",
"       <td>",
"        Withdrawal can cause extreme hypertension and myocardial ischemia.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery. Substitute transdermal clonidine or rarely IV methyl dopa.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Calcium channel blockers",
"       </td>",
"       <td>",
"        Conflicting evidence on whether there is an increased risk of bleeding.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery. No IV substitution necessary unless poor hemodynamics (hypertension or arrythmia).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ace inhibitors and angiotensin receptor blockers",
"       </td>",
"       <td>",
"        Continuation can result in hypotension.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery if using for hypertension. Discontinue on day of surgery if using for HF and baseline blood pressure is low.",
"       </td>",
"       <td>",
"        Continue therapy up to and including day of surgery if using for hypertension. Discontinue on day of surgery if using for HF and baseline blood pressure is low. Use parenteral enalaprilat as needed in postoperative period.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diuretics",
"       </td>",
"       <td>",
"        Continuation can result in hypovolemia and hypotension.",
"       </td>",
"       <td>",
"        Continue therapy up to day of surgery but discontinue morning dose.",
"       </td>",
"       <td>",
"        Continue therapy up to day of surgery but discontinue morning dose. Use parenteral forms as needed in postoperative period.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Statins",
"       </td>",
"       <td>",
"        Continuation may elevate risk of myopathy, but provides cardiovascular protection.",
"       </td>",
"       <td>",
"        Continue statins.",
"       </td>",
"       <td>",
"        Continue statins up to and including day of surgery.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Non-statin lipid-lowering agents",
"       </td>",
"       <td>",
"        Niacin and fibric acid derivatives may cause rhabdomyolysis. Bile acid sequestrants interfere with absorption of other medications.",
"       </td>",
"       <td>",
"        Discontinue day before surgery.",
"       </td>",
"       <td>",
"        Discontinue day before surgery. Resume with oral intake.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f42_50_43820=[""].join("\n");
