var title_f42_50_43821="Oral CMF for breast cancer";
var content_f42_50_43821=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F69601&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F69601&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Oral cyclophosphamide, methotrexate, and fluorouracil chemotherapy for breast cancer",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle length: 28 days.",
"        <br/>",
"        Total cycles: 6.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cyclophosphamide",
"        </strong>",
"       </td>",
"       <td>",
"        100 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        orally daily",
"       </td>",
"       <td>",
"        See special instructions below.",
"       </td>",
"       <td>",
"        Days 1 through 14",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Methotrexate",
"        </strong>",
"       </td>",
"       <td>",
"        40 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        Methotrexate is available in a 25 mg/mL solution that needs no further dilution. It can be administered as a slow IV push.",
"       </td>",
"       <td>",
"        Days 1 and 8",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Fluorouracil",
"        </strong>",
"       </td>",
"       <td>",
"        600 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        per day IV",
"       </td>",
"       <td>",
"        Drug is available in 50 mg/mL solution that needs no further dilution prior to administration as IV push.",
"       </td>",
"       <td>",
"        Days 1 and 8",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Patients should maintain adequate hydration (2 to 3 L/day), void frequently, and avoid taking cyclophosphamide at bedtime to reduce the risk of bladder irritation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        MODERATE (30 to 90 percent frequency of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        No specific premedication regimen is indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        Primary prophylaxis with G-CSF is not indicated",
"        <sup>",
"         [1]",
"        </sup>",
"        . Refer to UpToDate topic on \"Prophylaxis of infection during chemotherapy-induced neutropenia\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        A lower starting dose of fluorouracil may be needed for patients with liver impairment. A lower starting dose of cyclophosphamide may be needed in patients with renal or hepatic impairment. Refer to UpToDate topics on \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\" and \"Chemotherapy hepatotoxicity and dose modication in patients with liver disease\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Special instructions:",
"        </strong>",
"        Patients should be warned against cutting or crushing cyclophosphamide tablets",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential and platelet count on days 1 and 8 of each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Serum electrolytes, renal, and liver function once per cycle on day 1.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for diarrhea and cutaneous toxicity.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        If the ANC is less than 1000 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        or platelets are less than 75,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        on day 1 of each cycle, therapy should be delayed until counts recover, at which time 75 percent of the calculated dose should be administered, or 100 percent of the dose if the ANC is &gt;2000 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        and the platelet count is &ge;100,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        . If the ANC on day 8 is less than 1000 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        or platelets less than 75,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        , the day 8 doses of methotrexate and fluorouracil should be omitted",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for diarrhea:",
"        </strong>",
"        Withhold fluorouracil for grade 2 or worse diarrhea and restart at a lower dose after complete resolution.",
"        <strong>",
"         NOTE:",
"        </strong>",
"        Severe diarrhea and mucositis after fluorouracil should prompt evaluation for dihydropyrimidine dehydrogenase deficiency. Refer to UpToDate topic on \"Enterotoxicty of chemotherapeutic agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Palmar-plantar erythrodysesthesia:",
"        </strong>",
"        Hold fluorouracil for grade 2 or greater palmar plantar erythrodysesthesia, and reduce subsequent dose by 20 percent",
"        <sup>",
"         [3]",
"        </sup>",
"        . Refer to UpToDate topic on \"Cutaneous complications of conventional chemotherapy agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated for all drugs.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; G-CSF: granulocyte colony-stimulating factors; CBC: complete blood count; ANC: absolute neutrophil count.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Fisher B, et al. J Clin Oncol 1990; 8:1483.",
"      </li>",
"      <li>",
"       Cytoxan (cyclophosphamide) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on July 3, 2012).",
"      </li>",
"      <li>",
"       Fluorouracil injection FDA-approved package insert US National Library of Medicine. (Available online at www.dailymed.nlm.nih.gov, accessed July 3, 2012).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
