var title_f42_50_43822="Peak and plateau pressure";
var content_f42_50_43822=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F71863&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F71863&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Peak and plateau pressures",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 430px; height: 505px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relationship between tidal volume and airway pressure during mechanical ventilation. The inspiratory plateau in the volume tracing is achieved by temporary occlusion of the expiratory limb of the ventilator circuit. During this period, airway pressure falls from a peak of 20 cmH",
"    <sub>",
"     2",
"    </sub>",
"    O to a plateau pressure of 10 cmH",
"    <sub>",
"     2",
"    </sub>",
"    O. These measurements allow the calculation of respiratory system (or thoracic) compliance. The static compliance of the respiratory system is equal to the exhaled tidal volume divided by the difference between plateau and positive end-expiratory pressures (Crs = Vt / Plat-PEEP). An increase in the difference between peak and plateau pressures implies increased airway resistance.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Tobin, MJ. Respiratory monitoring. JAMA 1990; 264:244.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
